import { READ_ONE, READ_ALL, START, END } from './action-type'

export default {
    changebool(params) {
        return {
            type: START
        }
        return (dispatch) => {
            setTimeout(() => {
                let action = {
                    type: READ_ONE,
                    params: params
                }
                dispatch(action)
                return {
                    type: END
                }
            }, 1000)
        }
    },
    changeAllbool() {
        return {
            type: READ_ALL
        }
    }
}
